void draw_cuddles( int start_frame, int end_frame ){
	int x,y, i = 0 , j = 0;
	uint16_t color_start, color_end;
	
	for( y = DISPLAY_CENTER_Y - CUDDLES_Y/2, i = 0 ; y<=  DISPLAY_CENTER_Y + CUDDLES_Y/2 ; y += 1 , i += 1 ) {
		for  ( x = DISPLAY_CENTER_X - CUDDLES_X/2, j = 0 ; x <= DISPLAY_CENTER_X + CUDDLES_X/2 ; x += 1 , j+= 1 ) {
			color_end = cuddles_matrix[end_frame][i][j];
			if( start_frame != -1 ) {
				color_start = cuddles_matrix[start_frame][i][j];
				if ( color_start == color_end){
					continue;
				}
			}
			LCD_SetPoint ( x , y , color_end );
		}
	}
}

void draw_speaker_on(int x_start, int y_start){
	LCD_DrawRectangle(x_start, y_start + 4, 3, 4, Black);
	LCD_DrawRectangle(x_start +3, y_start + 3, 1, 6, Black);
	LCD_DrawRectangle(x_start +4, y_start + 2, 1, 8, Black);
	LCD_DrawRectangle(x_start +5, y_start + 1, 1, 10, Black);
	LCD_DrawRectangle(x_start +6, y_start, 1, 12, Black);
}

void draw_speaker_off(int x_start, int y_start){
	LCD_DrawLine(x_start, y_start, x_start + 11 , y_start+11, Red);
}

void draw_speaker_level(int x_start, int y_start, int volume_value){
	int i = 0;
	// vol : VOL_MAX = x : 3 => x = 3 * vol / VOL_MAX
	while( i < 3 ){
		if( i < (3 * volume_value / 8) ) { 
			LCD_DrawRectangle(x_start + 8 + (i*2), y_start + 4 - (i*2), 1, 4 * (i+1), Black);
		}else{
			LCD_DrawRectangle(x_start + 8 + (i*2), y_start + 4 - (i*2), 1, 4 * (i+1), White);
		}
		i+=1;
	}
}

